import { React, useState, useEffect } from "react";
import "./App.css";

function App() {
  const [post, setPost] = useState("");
  useEffect(() => {
    fetch("http://localhost:8000/testAPI")
      .then((res) => res.text())
      .then((res) => setPost(res));
  }, []);
  return (
    <div className="App">
      <h1>{post}</h1>
    </div>
  );
}

export default App;
